import styled from 'styled-components';
import Nav from './Nav';

const HeaderStyles = styled.header`
  .sub-bar {
    display: grid;
    grid-template-columns: 1fr auto;
    width: 40%;
    border: 1px solid grey;
  }
`;

const Header = () => (
  <HeaderStyles>
    <Nav />
    <div className="sub-bar">
      <p>Search</p>
    </div>
  </HeaderStyles>
);

export default Header;
